import React, {Component} from 'react';
import {BrowserRouter as Router, Link} from "react-router-dom";
import './App.css';

class App extends Component {
    componentDidMount() {
        this.setState({
            show: false
        })
    }

    test() {
        fetch("http://localhost:8080/shortestPath/maxDistance/C/C/30")
            .then(
                (result) => {
                    this.setState({
                        items: result,
                        show: true
                    });
                },
                (error) => {
                    this.setState({
                        error
                    });
                }
            )
    }

    render() {
        const show = this.state.show

        return (
            <Router>
                <div className="App">
                    <header className="App-header">
                        <h1>Welcome to ThoughtWorks Train Manage System!</h1>
                    </header>
                    <main>
                        <button onClick={this.test}>Test</button>
                        {show? <p>{this.state.items}</p> : null}
                    </main>
                </div>
            </Router>
        );
    }
}

export default App;
